import random
import urllib.request

class Image(object):

    def download_web_image(self, url):
        name = random.randrange(1, 1000)
        full_file_name = name = str(name) + ".jpg"
        urllib.request.urlretrieve(url, full_file_name)


my_class = Image()
my_class.download_web_image("data:image/jpeg;base64,")

